-- First clean up 
-- 1. Kill open sessions
SELECT pg_terminate_backend(pid) FROM pg_stat_activity WHERE pid <> pg_backend_pid() AND datname = 'boda';

-- 2. DROP database and role 
DROP DATABASE boda;
DROP ROLE bodastage;

-- Create user/role and database 
CREATE USER bodastage WITH PASSWORD 'password';
CREATE DATABASE boda owner bodastage;

-- Switch database
\c boda 

-- Switch ROLE/USR
SET ROLE bodastage;

-- Hex to integer
CREATE OR REPLACE FUNCTION hex_to_int(hexval varchar) RETURNS integer AS $$
DECLARE
   result  int;
BEGIN
	EXECUTE 'SELECT x''' || hexval || '''::int' INTO result;
	RETURN result;
END;
$$
LANGUAGE 'plpgsql' IMMUTABLE STRICT;

-- HEX to character/string
CREATE OR REPLACE FUNCTION hex_to_char(hexval varchar) RETURNS integer AS $$
DECLARE
   result  varchar;
BEGIN
	EXECUTE 'SELECT x''' || hexval || '''::int' INTO result;
	RETURN result;
END;
$$
LANGUAGE 'plpgsql' IMMUTABLE STRICT;


